import * as React from "react";
import styled from "styled-components";

function SideMenuButton(props) {
  return (
    <svg
      id="Layer_1"
      data-name="Layer 1"
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 216 144"
    >
      <path
        d="M144,0H0V144H144A72,72,0,0,0,144,0Zm0,135a63,63,0,1,1,63-63A63,63,0,0,1,144,135Z"
        style="fill:#9f7bc9"
      />
    </svg>
  );
}

const MemoSideMenuButton = React.memo(SideMenuButton);

const StyledButton = styled(MemoSideMenuButton)`
  width: 100px;
  position: absolute;
  left: 0;
`;

export default StyledButton;
